  updated_at timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  gender varchar(1) DEFAULT NULL,
  PRIMARY KEY (resident_id),
  UNIQUE KEY resident_id (resident_id),
  KEY beacon_id (beacon_id),
